BEGIN
                FOR h in 0..23 LOOP
                    MERGE INTO compute_capacity_tenant_summary t
                    USING (
                        SELECT region, ad, common_name, instance_shape, record_date, cores
                          FROM compute_capacity_tenant_summary_v
                         WHERE record_date = TRUNC(sysdate-1) + (h/24)
                    ) v
                    ON (t.region = v.region AND
                        t.ad = v.ad AND
                        t.common_name = v.common_name AND
                        t.instance_shape = v.instance_shape AND
                        t.record_date = v.record_date)
                    WHEN MATCHED THEN UPDATE SET t.cores = v.cores
                    WHEN NOT MATCHED THEN
                    INSERT (t.region, t.ad, t.common_name, t.instance_shape, t.record_date, t.cores)
                    VALUES (v.region, v.ad, v.common_name, v.instance_shape, v.record_date, v.cores);
                    COMMIT;
                END LOOP;
                DELETE FROM compute_capacity_tenant_summary
                 WHERE record_date < TRUNC(sysdate-7);
                COMMIT;
            END;

