DECLARE
  cursor cur_LUMOS_files is
    select a.oracle_directory, a.sub_directory, b.file_name, 
      SUBSTR(file_name,instr(file_name,'.json') - 8, 8) file_date,
      b.status
      from dw_stg_user.bmcdw_os_config a, dw_stg_user.bmcdw_os_queue b
     where a.service_name='IBA'-- v_service 
           and a.service_name = b.service_name and b.status='Pending'
    order by b.file_name;
v_return varchar2(2000);
BEGIN
 FOR V_FILES IN CUR_LUMOS_FILES LOOP
  IF INSTR (V_FILES.FILE_NAME, 'lumos_beehive_groups_ldap_users') > 1 THEN  
        v_return := iba_stg.f_ssdi_lumos_beehive_groups_ldap_users_stg (V_FILES.FILE_NAME);
    ELSIF INSTR (V_FILES.FILE_NAME, 'lumos_beehive_groups') > 1 THEN  
        v_return := iba_stg.f_ssdi_lumos_beehive_groups_stg (V_FILES.FILE_NAME); 
    ELSIF INSTR (V_FILES.FILE_NAME, 'lumos_cost_center') > 1 THEN  
        v_return := iba_stg.f_ssdi_lumos_cost_center_stg (V_FILES.FILE_NAME); 
    ELSIF INSTR (V_FILES.FILE_NAME, 'lumos_ldap_users') > 1 THEN  
        v_return := iba_stg.f_ssdi_lumos_ldap_users_stg (V_FILES.FILE_NAME); 
    ELSE NULL;
  END IF;
INSERT INTO dw_stg_user.load_history(record_date,region,ad,service_name,file_name,status,messages,load_date)
     values (to_date(substr(v_files.file_name,1,8),'YYYYMMDD'),null,null,'IBA',v_files.file_name,'OK',v_return,trunc(sysdate));
UPDATE DW_STG_USER.bmcdw_os_queue SET STATUS = 'Complete' where FILE_NAME = v_files.file_name AND SERVICE_NAME = 'IBA';
END LOOP;
END;
